-- Seed Data: Import 384 items from Sysco Inventory export
-- ════════════════════════════════════════════════════════════════
-- Run AFTER schema.sql in Supabase SQL Editor


-- Reset the auto-increment sequence to continue after existing IDs
SELECT setval('items_id_seq', (SELECT MAX(id) FROM items));

-- Verify import
SELECT category, COUNT(*) as item_count, ROUND(SUM(total_value)::numeric, 2) as total_value
FROM items GROUP BY category ORDER BY total_value DESC;